package org.giddap.dreamfactory.leetcode.onlinejudge;

import com.google.common.collect.Lists;
import org.giddap.dreamfactory.leetcode.onlinejudge.implementations.Q014LongestCommonPrefixImpl;
import org.junit.Test;

import static org.junit.Assert.assertEquals;
import static org.junit.Assert.assertNotNull;

public class Q014LongestCommonPrefixTest {
    private Q014LongestCommonPrefix solution = new Q014LongestCommonPrefixImpl();

    @Test
    public void small01() {
        String[] input = Lists.newArrayList("abcdt", "abc", "abceqwer").toArray(new String[0]);
        final String commonPrefix = solution.longestCommonPrefix(input);
        assertNotNull(commonPrefix);
        assertEquals("abc", commonPrefix);
    }

    @Test
    public void small02() {
        String[] input = Lists.newArrayList("a").toArray(new String[0]);
        final String commonPrefix = solution.longestCommonPrefix(input);
        assertNotNull(commonPrefix);
        assertEquals("a", commonPrefix);
    }
}

